import React, { useState } from "react";
import {
  Navbar,
  NavbarBrand,
  NavbarToggler,
  Collapse,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";
import Avatar from "react-avatar";
import { IoClose } from "react-icons/io5";
import { SidebarData } from "./SidebarData";
import "./Navi.css"

function Navi() {
  const [isOpen, setIsOpen] = useState(false);
  const showNavbar = () => setIsOpen(!isOpen);

  const [sidebar, setSidebar] = useState(false);
  const showSidebar = () => setSidebar(!sidebar);
  return (
    <div>
      <div>
        <Navbar color="light" expand="md" light>
          <NavLink to="#" className="menu-bars">
            <Avatar
              name="Foo Bar"
              round={true}
              size={40}
              onClick={showSidebar}
            />
          </NavLink>
          <NavbarToggler onClick={showNavbar} />
          <Collapse navbar isOpen={isOpen}>
            <Nav className="me-auto" navbar>
              <NavItem>
                <NavLink href="/library">My library</NavLink>
              </NavItem>
            </Nav>
            <form class="d-flex">
              <input
                class="form-control me-2"
                type="search"
                placeholder="Search"
                aria-label="Search"
              />
              <button class="btn btn-outline-success" type="submit">
                Search
              </button>
            </form>
          </Collapse>
        </Navbar>
        <Nav className={sidebar ? "nav-menu active" : "nav-menu"} className="flex-column">
          <NavItem className="navbar-toggle">
            <NavLink to="#" className="menu-bars">
              <IoClose />
            </NavLink>
          </NavItem>

          {SidebarData.map((item, index) => {
            return (
              <NavItem key={index} className={item.cName}>
                <NavLink to={item.path}>
                  {item.icon}
                  <span>{item.title}</span>
                </NavLink>
              </NavItem>
            );
          })}
        </Nav>
      </div>
    </div>
  );
}

export default Navi;
